  { id: "e-1", title: "event-1" },
  { id: "e-1", title: "event-1" },
  { id: "e-1", title: "event-1" },
];
export default function EventsPage() {
  return (
    <ul>
      {DUMMY_EVENTS_ARRAY.map((el) => (
        <li key={el.id}>{el.title}</li>
      ))}
    </ul>
  );
}
